// React component: Administration Tools (Tab 6)
import React, { useState } from 'react';

const AdminToolsPage = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [loggedIn, setLoggedIn] = useState(false);
  const [selectedFile, setSelectedFile] = useState(null);

  const handleLogin = () => {
    if (username === 'Masterblaster!' && password === 'LetMeIn') {
      setLoggedIn(true);
    } else {
      alert('❌ Incorrect Username or Password. Access Denied.');
    }
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setSelectedFile(file ? file.name : null);
  };

  const handleImport = () => {
    if (selectedFile) {
      alert(`✅ ${selectedFile} imported into program successfully.`);
    } else {
      alert('❗ Please select a file before importing.');
    }
  };

  return (
    <div className="p-4 border rounded shadow bg-white">
      <h2 className="text-xl font-bold mb-4">🛠️ Administration Tools</h2>

      {!loggedIn ? (
        <div>
          <label className="block mb-2">Username:</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            className="border p-2 mb-4 w-full"
          />
          <label className="block mb-2">Password:</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            className="border p-2 mb-4 w-full"
          />
          <button onClick={handleLogin} className="bg-blue-600 text-white px-4 py-2 rounded">
            Submit
          </button>
        </div>
      ) : (
        <div>
          <p className="mb-4 text-green-700">Welcome, Masterblaster!</p>
          <div className="mb-4">
            <label className="block mb-1 font-semibold">📥 Download This Week's Games</label>
            <input type="file" onChange={handleFileChange} className="mb-2" />
            {selectedFile && <p className="text-sm">Selected File: {selectedFile}</p>}
            <button onClick={handleImport} className="bg-green-600 text-white px-4 py-2 mt-2 rounded">
              Save and Import File
            </button>
          </div>

          <div className="mt-6">
            <label className="block mb-2 font-semibold">👥 Player Manager</label>
            <table className="w-full table-auto border">
              <thead>
                <tr>
                  <th className="border px-4 py-2 text-left">Game Name</th>
                  <th className="border px-4 py-2 text-left">Payment ($)</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td className="border px-4 py-2">PackAttack23</td>
                  <td className="border px-4 py-2">25.00</td>
                </tr>
                <tr>
                  <td className="border px-4 py-2">BlitzQueen</td>
                  <td className="border px-4 py-2">15.00</td>
                </tr>
                <tr>
                  <td className="border px-4 py-2">NewPlayer2025</td>
                  <td className="border px-4 py-2">0.00</td>
                </tr>
              </tbody>
            </table>
            <div className="mt-4">
              <input placeholder="Game Name" className="border p-2 mr-2" />
              <input placeholder="Amount Paid" className="border p-2 mr-2" />
              <button className="bg-blue-500 text-white px-4 py-2 rounded">Save Player</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AdminToolsPage;
